import React, { useEffect, useRef, useState } from 'react';
import {
    ChartBarIcon,
    CpuChipIcon,
    ShieldCheckIcon,
    LightBulbIcon,
    ClockIcon,
    GlobeAltIcon
} from '@heroicons/react/24/outline';

const FeatureCard = ({ icon: Icon, title, description, delay = 0 }) => {
    const [isVisible, setIsVisible] = useState(false);
    const cardRef = useRef(null);

    useEffect(() => {
        const observer = new IntersectionObserver(
            ([entry]) => {
                if (entry.isIntersecting) {
                    setTimeout(() => setIsVisible(true), delay);
                }
            },
            { threshold: 0.1 }
        );

        if (cardRef.current) {
            observer.observe(cardRef.current);
        }

        return () => observer.disconnect();
    }, [delay]);

    return (
        <div
            ref={cardRef}
            className={`group bg-white rounded-xl p-6 shadow-sm border border-gray-100 hover:shadow-lg hover:border-primary-200 transition-all duration-500 ${isVisible ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-4'
                }`}
        >
            <div className="w-12 h-12 bg-primary-50 rounded-lg flex items-center justify-center mb-4 group-hover:bg-primary-100 transition-colors duration-300">
                <Icon className="w-6 h-6 text-primary-500" />
            </div>
            <h3 className="text-xl font-display font-semibold text-gray-800 mb-3">
                {title}
            </h3>
            <p className="text-gray-500 leading-relaxed font-sans">
                {description}
            </p>
        </div>
    );
};

const FeaturesSection = () => {
    const [titleVisible, setTitleVisible] = useState(false);
    const titleRef = useRef(null);

    useEffect(() => {
        const observer = new IntersectionObserver(
            ([entry]) => {
                if (entry.isIntersecting) {
                    setTitleVisible(true);
                }
            },
            { threshold: 0.1 }
        );

        if (titleRef.current) {
            observer.observe(titleRef.current);
        }

        return () => observer.disconnect();
    }, []);

    const features = [
        {
            icon: ChartBarIcon,
            title: "Real-time Analytics",
            description: "Get instant insights into your website performance with live data updates and comprehensive reporting."
        },
        {
            icon: CpuChipIcon,
            title: "AI-Powered Insights",
            description: "Leverage machine learning algorithms to uncover hidden patterns and predict future trends."
        },
        {
            icon: ShieldCheckIcon,
            title: "Data Security",
            description: "Enterprise-grade security ensures your data is protected with end-to-end encryption."
        },
        {
            icon: LightBulbIcon,
            title: "Smart Recommendations",
            description: "Receive actionable suggestions to optimize your website performance and user experience."
        },
        {
            icon: ClockIcon,
            title: "24/7 Monitoring",
            description: "Continuous monitoring of your website with instant alerts for any performance issues."
        },
        {
            icon: GlobeAltIcon,
            title: "Global Coverage",
            description: "Monitor your website performance from multiple locations worldwide for comprehensive insights."
        }
    ];

    return (
        <section className="py-20 bg-gray-25">
            <div className="container mx-auto px-4 sm:px-6 lg:px-8">
                {/* Header */}
                <div
                    ref={titleRef}
                    className={`text-center mb-16 transition-all duration-1000 ${titleVisible ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-4'
                        }`}
                >
                    <p className="text-primary-500 text-sm font-medium uppercase tracking-wide mb-4 font-sans">
                        Features
                    </p>
                    <h2 className="text-3xl sm:text-4xl lg:text-5xl font-display font-semibold text-gray-800 mb-6">
                        Your trusted companion.
                        <br />
                        Transforming exploration and innovation
                    </h2>
                    <p className="text-lg text-gray-500 max-w-3xl mx-auto font-sans">
                        Gain a comprehensive understanding of your visitors' behavior with
                        advanced analytics powered by AI.
                    </p>
                </div>

                {/* Features Grid */}
                <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
                    {features.map((feature, index) => (
                        <FeatureCard
                            key={index}
                            icon={feature.icon}
                            title={feature.title}
                            description={feature.description}
                            delay={index * 100}
                        />
                    ))}
                </div>

                {/* Bottom CTA */}
                <div className={`text-center mt-16 transition-all duration-1000 delay-600 ${titleVisible ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-4'
                    }`}>
                    <div className="bg-white rounded-2xl p-8 shadow-lg max-w-2xl mx-auto border border-gray-100">
                        <h3 className="text-2xl font-display font-semibold text-gray-800 mb-4">
                            Ready to transform your analytics?
                        </h3>
                        <p className="text-gray-500 mb-6 font-sans">
                            Join thousands of businesses already using Intelly to make data-driven decisions.
                        </p>
                        <button className="bg-primary-500 text-white font-semibold px-8 py-3 rounded-lg hover:bg-primary-600 transition-colors duration-200 font-display">
                            Start Free Trial
                        </button>
                    </div>
                </div>
            </div>
        </section>
    );
};

export default FeaturesSection;
